  \"2016-10-08T15:56:09.662385\",\n\t\"name\": \"elk-and-deer-management-plan-and-environmental-assessment-fort-niobrara-national-wildlife-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The purpose of this Elk and Deer Management
  Plan and Environmental Assessment (EDMP/EA) is to develop and evaluate alternative
  actions for management of elk and deer on Fort Niobrara National Wildlife refuge
  (NWR). An elk and deer hunting program, which is a proposed action in some of the
  management alternatives, is described in detail in Appendix A. Each alternative,
  along with a proposed hunt program, is evaluated for environmental consequences
  in accordance with the National Environmental Policy Act (NEPA). The preferred alternative
  for the Fort Niobrara Elk and Deer Management Plan, including the Fort Niobrara
  Hunt Plan, will need to be compatible with legislation governing Fort Niobrara NWR,
  the National Wildlife Refuge System, and the National Wilderness System.\",\n\t\"license_title\":
